import './App.css';
import Google from "./componentes/Google.js"
import Input from "./componentes/Input.js"


function App() {
  return (
    <div className='Center'>
    <div><Google></Google></div>
    <div className='input'><Input></Input></div>
    </div>
  );
}

export default App;
